import React,{Component} from 'react';
import {Container,Tab,Menu} from 'semantic-ui-react'

class DashBoard extends Component {


      render(){
        const panes = [
          { menuItem: 'Add Survey', render: () => <Tab.Pane></Tab.Pane> },
          { menuItem: 'Add Question To Survey', render: () => <Tab.Pane></Tab.Pane> }
                ]
          return(
            <div>              
    <Container style={{paddingTop:20}} >
            <Menu>
    <Container>
      <Menu.Item as="h2" header>
             i-Survey Admin
      </Menu.Item>

      <Menu.Menu position="right">
        <Menu.Item name="logout">
        </Menu.Item>
      </Menu.Menu>
    </Container>
  </Menu>     
  </Container>

  <Container style={{paddingTop:0.8 + 'em'}}>
     <Tab menu={{ fluid: true, vertical: true }} menuPosition='left' panes={panes} />
  </Container>
          </div>
          );

      }


}



export default DashBoard
